import React, { Component } from 'react'

class Filter extends Component {

  render() {
    const options = this.props.options.map((option) => {
      return (
        <option>
          { option }
        </option>
      )
    })

    return (
      <select>
        {options}
      </select>
    )
  }
}

export default Filter
